package edu.pku.sei.conditon.dedu.extern.pf;

public class PathFindingException extends Exception {
	
	private static final long serialVersionUID = 3761235649814987138L;

	public PathFindingException() {
		super();
	}

	public PathFindingException(String message, Throwable cause, boolean enableSuppression,
			boolean writableStackTrace) {
		super(message, cause, enableSuppression, writableStackTrace);
	}

	public PathFindingException(String message, Throwable cause) {
		super(message, cause);
	}

	public PathFindingException(String message) {
		super(message);
	}

	public PathFindingException(Throwable cause) {
		super(cause);
	}
	
}
